// SPDX-License-Identifier: MIT

pragma solidity ^0.8.19;

contract CarRentalService {
    // State variables
    address public owner;
    uint public rentalPricePerDay;
    uint public availableCars;
    uint public rentalPriceSedan;
    uint public rentalPriceSUV;
    uint public rentalPriceTruck;
    uint public rentProfit;

    mapping (address => uint) public customerBalance;
    mapping (address => uint) public rentedCars;

    // Constructor
    constructor(uint _availableCars) payable {
        owner = msg.sender;
        rentalPricePerDay = 2 ether;
        rentalPriceSedan = 1 ether;
        rentalPriceSUV = 2 ether;
        rentalPriceTruck = 3 ether;
        rentProfit = 0.5 ether;
        availableCars = _availableCars;
    }

    // Functions
    function getRentalServiceBalance() public view returns (uint _balance) {
        return address(this).balance;
    }

    function restock(uint _quantity) public {
        require(msg.sender == owner, "Only the owner can restock this rental service.");
        availableCars += _quantity;
    }

    function rentCar_Day(uint _days) public payable {
        require(msg.value >= rentalPricePerDay * _days, "Not enough funds.");
        require(availableCars > 0, "No cars available.");
        require(rentedCars[msg.sender] == 0, "You can only rent one car at a time.");

        customerBalance[msg.sender] += msg.value;
        rentedCars[msg.sender] = _days;
        availableCars -= 1;
    }
        function rentCar_Sedan(uint _days) public payable {
        require(msg.value >= rentalPriceSedan * _days, "Not enough funds.");
        require(availableCars > 0, "No Sedan available.");
        require(rentedCars[msg.sender] == 0, "You can only rent one Sedan at a time.");

        customerBalance[msg.sender] += msg.value;
        rentedCars[msg.sender] = _days;
        availableCars -= 1;
    }
        function rentCar_SUV(uint _days) public payable {
        require(msg.value >= rentalPriceSUV * _days, "Not enough funds.Hello");
        require(availableCars > 0, "No SUV available.");
        require(rentedCars[msg.sender] == 0, "You can only rent one SUV at a time.");

        customerBalance[msg.sender] += msg.value;
        rentedCars[msg.sender] = _days;
        availableCars -= 1;
    }
        function rentCar_Truck(uint _days) public payable {
        require(msg.value >= rentalPriceTruck * _days, "Not enough funds.");
        require(availableCars > 0, "No Truck available.");
        require(rentedCars[msg.sender] == 0, "You can only rent one truck at a time.");

        customerBalance[msg.sender] += msg.value;
        rentedCars[msg.sender] = _days;
        availableCars -= 1;
    }

    function returnCar() public {
        require(rentedCars[msg.sender] > 0, "You haven't rented any cars.");
        
        uint daysRented = rentedCars[msg.sender];
        uint refundAmount = daysRented * rentalPricePerDay - 1;
        
        customerBalance[msg.sender] -= refundAmount;
        rentedCars[msg.sender] = 0;
        availableCars += 1;
        
        payable(msg.sender).transfer(refundAmount);
    }

}
